n phm thc t s c s chnh lch nh so vi nh do iu kin nh sng khi chp v mu sc hin th qua mn hnh my tnh/ in thoi.</p>\r\n</div>'),(223,85,0,112,'Merino Wool - o khoc d lng cu'),(224,76,0,112,'<div class=\"tab-content active showContent\">\r\n<p>o khoc c c, dng sung  di ngang hng. im nhn l ti vung 1 bn thu logo IVY moda. Ci bng hngkhuy pha trc.</p>\r\n<p>Vi cht liu o lm bng Lng cu cao cp, tri qua nhng bc thc hin t m v trau chut trong tng chi tit, mi thit k u c kim nh cht lng nghim ngt vi cng on x l th cng hng trm gi ng h. Cc mi khu tinh t, phom dng chun tng centimet mang n ng cp khc bit - sn phm th cng nhng v cng hin i.</p>\r\n<p>Kiu o ny khng ch m p m cn khin bn d phi  vi rt nhiu kiu  v ph kin khc nhau t qun jean, legging ti giy cao gt hay bt cao c, khn qung c,</p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nh do iu kin nh sng khi chp v mu sc hin th qua mn hnh my tnh/ in thoi.</p>\r\n</div>'),(225,85,0,113,'Premium Wool Vest'),(226,76,0,113,'<div class=\"tab-content active showContent\">\r\n<p>o vestd c 2 ve, tay di. 2 np ti gi to kiu 2 bn, 1khuy pha trc mix cng ph kin dy xch kim loi tr trung, c tnh.Thng qua nhng ng nt tinh xo nh cu vai sc ntv phom dng chun tng centimet  mang n s khc bit, ng cp cho thit k cng nh ngi mc.</p>\r\n<p>c bitcht liu o lm bng Lng cu pcao cp,khu tay 100% vi cc mi khu c khu t m kho lo khng lm l ch.Vi c im mm, mng, nh v gi m tuyt i. o khoc d p lng cu  tr thnh item khng th thiu ca phi p mi khi ng v.Nm bt kp xu hng cng nh nhu cu ny, IVY moda  cho ra i BST o khoc d p lng cu khu tay cao cp t chun vi nhiu kiu dng, mu sc cho phi p la chn.</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong> 167 cm</p>\r\n<p><strong>Cn nng:</strong> 50 kg</p>\r\n<p><strong>S o 3 vng: </strong>83-65-93 cm</p>\r\n<p>Mu mc size M</p>\r\n</div>'),(227,85,0,114,'Long Premium Wool Coat With Belt'),(228,76,0,114,'<div class=\"tab-content active showContent\">\r\n<p>o khoc d c 2 ve lt khot ch K, tay di. 2 ti vung c np2 bn. 1khuy pha trc, o km ai t