ca cc nh mt dnh cho cc thit k i hi s thanh lch, sang trngmvn m bo tnhthoi mi. Vi tuysi mm nh, thong mt, t nhn v gi form dng tt.Xu hng n quyn c IVY moda kt hp gia v p thanh lch, sang trng nhng vn  cao s thoi mi, d chu t phom dng n cht liu mm mi.</p>\r\n<p>Khng ch p t thit k n cht liu, set  cn mang tnh ng dng cao, ph hp cho cc c nng din ni cng s v i ds kin.</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao: </strong> 169 cm</p>\r\n<p><strong>Cn nng: </strong> 48 kg</p>\r\n<p><strong>S o 3 vng: </strong>80-60-90 cm</p>\r\n<p>Mu mc size S</p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nh do iu kin nh sng khi chp v mu sc hin th qua mn hnh my tnh/ in thoi.</p>\r\n</div>'),(351,85,0,176,'Cropped Tweed Set II'),(352,76,0,176,'<div class=\"tab-content active showContent\">\r\n<p>Set  gm o khoc croptopv chn vy mini. o khoc tweed dng ngn c trn, tay di. Vin dy vn thng khc mu to im nhn. C ph kin hoa nh bn ngc. Vi tweed dy dn bn trong lt lp vi la. Chn vy mini ngngip nng kho lo khoe i chn mnh, c bit \"n gian\" chiu cao khi  l nhiu phn chn.</p>\r\n<p>Vic s dngcht liu cao cp nht th trng nh Tweed  em li s sang trng cho c set . Cht liuTweed c s dng l loi vidy dn c dt t nhng si len nhiu muc cutrc vnxon.B mt vi Tweed c  g gh nh c trng, bn trong c lp lt la mm mi. Tnhcao cp ca cht liu Tweed em li l s mm nh, kh nng chng nc, chng lnh tt.</p>\r\n<p>Ly cm hng t b suit c in, cc nh mt IVY \"tr ha\" b suit, gip cc c nng din lntrngtht thanh lch, sang trng m vn gi c nttr trung, ng yu.</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong> 167 cm</p>\r\n<p><strong>Cn nng:</strong> 50 kg</p>\r\n<p><strong>S o 3 vng:</strong>83-65-93 cm</p>\r\n<p>Mu mc size M</p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nh do iu kin nh sng khi chp v mu sc hin th qua mn hnh my tnh/ in thoi.</p>\r\n</div>'),(353,85,0,177,'Set B Vest cng s'),(354,76,0,177,'<div class=\"tab-content active showContent\">\r\n<p>Set  gm o vest v qun di ng ng. Thit k o vest c 2 v