ng:</strong>100-78-95 cm</p>\r\n</div>'),(629,85,0,315,'o khoc chn bng'),(630,76,0,315,'<div class=\"tab-content active showContent\">\r\n<p>- Cht liu vi Polyester, o may chnbng nhn to tc dng gi m cc tt vo nhng ngy i hn</p>\r\n<p>- o khoc phao dng sung, c s mi, ci bng hng khuy pha trc</p>\r\n<p>- Trc ngcphi 2 ti vung c np v 2 ti cho 2 bn</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong> 175 cm</p>\r\n<p><strong>Cn nng:</strong> 70 kg</p>\r\n<p><strong>S o 3 vng:</strong>98-75-97 cm</p>\r\n<p>Mu mc size L</p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nh do iu kin nh sng khi chp v mu sc hin th qua mn hnh my tnh/ in thoi.</p>\r\n</div>'),(631,85,0,316,'o khoc phao siu nh'),(632,76,0,316,'<div class=\"tab-content active showContent\">\r\n<p>- Cht liu vi Polyester, bn trong lt bngtc dng gi m tt vo nhng ngy i hn</p>\r\n<p>- o khoc phao dng sung, c cao, ci bng kha ko phi trc</p>\r\n<p>- Thit k tr trung,  di va phi cngtrng lng nh mang li cm gic thoi mi, m p nht khi mc</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong>175cm</p>\r\n<p><strong>Cn nng:</strong>65kg</p>\r\n<p>Mu mc size S</p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nh do iu kin nh sng khi chp v mu sc hin th qua mn hnh my tnh/ in thoi.</p>\r\n</div>'),(633,85,0,317,'Track Jacket - o khoc gi dng c bn'),(634,76,0,317,'<p>- Cht liu: Polyester tng hpdy dn, tnh nng chng gi, chng bi, gi m c th.</p>\r\n<p>- o khoc 2 lpdng sung,  di ngang hng, s dng kha kokn mnh (chng gi, chng thm nc)</p>\r\n<p>- o tay di, 2ti cho 2 bn c kha kotin li, gu o phi chun bn to co gin.Phom dng regular ph hp vi vc dng ngi Vit</p>\r\n<p>- Sn xut nm 2022 ti Vit Nam</p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nhdo iu kin nh sng khi chp v mu sc hin thqua mn hnh my tnh/ inthoi.</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong>175 cm</p>\r\n<p><strong>Cn nng:</strong>70 kg</p>\r\n<p><strong>S o 3 vng:</strong>98-75-97 cm</p>'),(635,8