haki cp chun co gin, 2 ti cho 2 bn - 2 vin ti gi pha sau. Gu bo chun co gin.</p>\r\n<p>Mu sc:Xanh Tm Than - en</p>\r\n<p><strong>Mu nh mc size 8-9:</strong><strong>1m33- 25kg</strong></p>\r\n</div>'),(901,85,0,451,'Qun di khaki in hnh'),(902,76,0,451,'<div class=\"tab-content active showContent\">\r\n<p>Qun di khaki b trai. Cp chun co gin c dy ko rt. Gu qun bo chun co gin. 2 ti c np bn ng qun. Mix cng o polo, o s mi cho b!</p>\r\n<p>Mu sc: Ha tit Xanh Ru - Ha tit Ghi Khi</p>\r\n</div>\r\n<div class=\"show-more\"></div>'),(903,85,0,452,'Qun sooc rn ri'),(904,76,0,452,'<div class=\"tab-content active showContent\">\r\n<p>Qun sooc c lm t cht liu thun mm. Cp qun chun c may gi kha. Ha tit rn ri xanh qun i mang n v nghch ngm, nam tnh cho cc cu nhc.</p>\r\n<p>Mu sc: Ha tit Xanh oliu</p>\r\n<p><strong>Mu nh mc size 8-9</strong></p>\r\n<p>Chiu cao: 1m37- Cn nng: 39kg</p>\r\n</div>'),(905,85,0,453,'Qun Thun di bo gu'),(906,76,0,453,'<div class=\"tab-content active showContent\">\r\n<p>T  byu trong tit tri giao manh hin ti chc chn khng th thiu mu qun thun di. Qun s dng cht liu thun nh cao cp va thong mt ngy h va gi m ngy ng.</p>\r\n<p>Qun cp chn, bo gu chn v c ti sn. Qun kt hp c vi nhiu kiu o khc nhau, thch hp  b din i hc hay i chi. </p>\r\n</div>'),(907,85,0,454,'Qun di thun ho tit'),(908,76,0,454,'<p>Thit k qun di ho tit ng nghnh dnh tng b yu. Qun cht liu thun cao cp, mang n s thong mt m cn rt an ton vi ln da nhy cm ca b.</p>'),(909,85,0,455,'Qun sooc kaki b trai'),(910,76,0,455,'<p>Vi  di ngang i, qun sooc kaki s gip b trai thoi mi vn ng v trnh b nng trong nhng ngy nng nng. Cht liu kaki bn b v d git lm cho sn phm ny tr thnh la chn u tin hng u cho cc bc cha m.</p>\r\n<p>Ba m cng c th phi mn  trn vi nhiu loi o khc nhau cho b mc, t o thun, o s mi hoc o khoc  to ra nhiu phong cch thi trang. Vi mt i giy th thao, b trai s trng tht snh iu v thoi mi. Sn phm qun sooc cho b trai chc chn s l mt la chn tuyt vi  din cho b trong ma h.</p>'),(911,85,0,456,'Qun thun di dng m'),(912,76,0,456,'<div class=\"tab-content active showContent\">\r\n<p>Qun thun b trai dng di, bo gu, cp chun, 2 bn c 2 ti cho. Cht liu vi thun mm mn, thoi mi,gi m ttph hp cho b mc  nh, i chi.<br />Qun din cng o ng b 58K1531</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong>138cm</p>\r\n<p><strong>Cn nng:</strong>38kg</p>\r\n<p><strong>Mu mc size 8-9</strong></p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nhdo iu kin nh sng khi chp v mu sc hin thqua mn hnh my tnh/ inthoi.</p>\r\n</div>'),(913,85,0,457,'Qun di kaki eo chun'),(914,76,0,457,'<div class=\"tab-content active showContent\">\r\n<p>Qun b trai dng di, gu gp to kiu, cp chun co gin thoi mi, 2 bn c 2 ti cho. Cht liu vi khaki dy dn,mm mn to phom dng khe khon. Qun d dng mix cng nhiu kiu o khc nhau, ph hp cho b din i hc hay i chi.</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong>138cm</p>\r\n<p><strong>Cn nng:</strong>38kg</p>\r\n<p><strong>Mu mc size 8-9</strong></p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nhdo iu kin nh sng khi chp v mu sc hin thqua mn hnh my tnh/ inthoi.</p>\r\n</div>'),(915,85,0,458,'Qun khaki jogger b trai'),(916,76,0,458,'<div class=\"tab-content active showContent\">\r\n<p>Qun jogger b trai dng di, bo chun gu, cp chun co gin thoi mi, 2 bn c 2 ti cho, qun phi ti hp 1 bn to im nhn. Cht liu vi khaki dy dn,mm mn to phom dng khe khon. Qun d dng mix cng nhiu kiu o khc nhau, ph hp cho b din i hc hay i chi.</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong>138cm</p>\r\n<p><strong>Cn nng:</strong>38kg</p>\r\n<p><strong>Mu mc size 8-9</strong></p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nhdo iu kin nh sng khi chp v mu sc hin thqua mn hnh my tnh/ inthoi.</p>\r\n</div>'),(917,85,0,459,'Qun thun di bo gu II'),(918,76,0,459,'<div class=\"tab-content active showContent\">\r\n<p>Qun thun b trai dng di, bo gu, cp chun, 2 bn c 2 ti cho. Cht liu vi thun mm mn, gi m ttph hp cho b mc  nh, i chi. Qun mc cng o thun MS 58K1512</p>\r\n<p><strong>Thng tin mu:</strong></p>\r\n<p><strong>Chiu cao:</strong>138cm</p>\r\n<p><strong>Cn nng:</strong>38kg</p>\r\n<p><strong>Mu mc size 8-9</strong></p>\r\n<p>Lu : Mu sc sn phm thc t s c s chnh lch nh so vi nhdo iu kin nh sng khi chp v mu sc hin thqua mn hnh my tnh/ inthoi.</p>\r\n</div>');
